import React from "react";
import {  StyleSheet, Text, View } from "react-native";
import { MaterialIcons } from '@expo/vector-icons';
import styled from "styled-components";
import { Button } from 'react-native-elements';
import { borderColor } from "styled-system";

export default function Athlete(){
    return(
        <View style= {styles.container}>
            <Text style={styles.title}>
            <MaterialIcons name="sports" size={24} color="black" />
            <Text>종목별 체육관 찾기</Text>
            </Text>
          {/* <ButtonWrap>
          <MaterialIcons name="sports-soccer" size={24} color="black" />
          <Caption>축구</Caption>
          </ButtonWrap> */}
          <ButtonWrap style={buttonwrapper} >
          <Button style={styles.buttontext} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="축구" type="outline" />
          </ButtonWrap>
        
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="농구" type="outline" />
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="야구" type="outline" />
        <Button style={styles.button} icon={<MaterialIcons name="sports-soccer" size={24} color="black" />} title="배드민턴" type="outline" />
        {/* <Button title="농구"/>
        <Button title="배구"/>
        <Button title="탁구"/>
        <Button title="배드민턴"/> */}
        </View>
    );
}
const ButtonWrap = styled.div`
width: 64px;
height: 64px; 
border-radius: 24px;
border: 1px solid #ECECF5;
`

const styles = StyleSheet.create({
    container: {
      flex: 1,
      justifyContent: 'center',
      marginHorizontal: 16,
    },
    title: {
      textAlign: 'center',
      fontSize: 24,
      marginVertical: 8,
    },
    fixToText: {
      flexDirection: 'row',
      justifyContent: 'space-between',
    },
    separator: {
      marginVertical: 8,
      borderBottomColor: '#737373',
      borderBottomWidth: StyleSheet.hairlineWidth,
    },
    buttonSize: {
        margin : 10
    },
    buttonwraper: {
      width: 60,
      height: 65,
      borderRadius: 5,
      borderColor: '#aaaaaa'
    },
    buttontext: {
        alignItems: "center",
        backgroundColor: "#FFFFFF",
        padding: 10,
        
        // border: 1px solid #ECECF5
    }
  });
